import React from "react";
import image from "public/profile.png";

function Home() {
  return (
    <div>
      <h1>Pupster</h1>
      <img src={image} alt="logo" />
      <h2>They're the Good Boys and Girls</h2>
    </div>
  );
}

export default Home;
